## Summon Fangs

---

Summons fangs in a row in front of the entity, or in a circle if the entity is sneaking.

---

### Example
```json
{
    "entity_action": {
        "type": "moborigins:summon_fangs"
    }
}
```
Executes the summon fangs action.

